import React, { Component } from 'react';

class GridSystem extends Component {
    render(){
        console.log(this.props.grid)
        var location = document.getElementById(this.props.grid);
        location.innerText = "asd";

        return (
            <h2>asd</h2>
        )
    }

}

export default GridSystem;
